{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"#  Bellabeat Study Case - Google Data Analytic Capstone","metadata":{}},{"cell_type":"markdown","source":"# Background\n\nBeallabeat is a high-tech company that manufactures health-focused smart products. Their gathering of data on activity, sleep, stress, and reproductive health has enabled Bellabeat to empower women with knowledge about their own health and habits. Since its founding in 2013, Bellabeat has grown rapidly and quickly positioned itself as a technology-based healthcare company for women. The company has invested in traditional advertising media, such as radio, outdoor billboards, print, and television, but focuses on digital marketing extensively.\n\n### Table of Contents\n\n\n\n* [1. Ask](#ask)\n\n* [2. Prepare](#prepare)\n\n* [3. Process](#process)\n\n* [4. Analyze](#analyze)\n\n* [5. Share & Act](#share)\n\n","metadata":{}},{"cell_type":"markdown","source":"<a id=\"ask\"></a>\n## 1.Ask\n#### Questions for the analysis\n1. What are some trends in smart device usage?\n2. How could these trends apply to Bellabeat customers?\n3. How could these trends help influence Bellabeat marketing strategy\n\n#### Businees Task\nFocuses on Bellabeat products and analyzes smart device usage data to gain insight into how customers use their smart devices. Then, using this information, provide high-level recommendations on how these trends can help develop Bellabeat's marketing strategy.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"prepare\"></a>\n## 2.Prepare\nThis Kaggle dataset from [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit) contains personal fitness trackers from thirty fitbit users. Thirty eligible Fitbit users consented to the delivery of personal tracking data, including minute-rate output for physical activity, heart rate, and sleep monitoring. This includes information about daily activity, steps, and heart rate that can be used to explore the user's habits.","metadata":{}},{"cell_type":"code","source":"#Load packages\n\nlibrary(tidyverse)          # for wrangle data\nlibrary(dplyr)              # for transforming data sets\nlibrary(janitor)            # for examining and cleaning dirty data\nlibrary(lubridate)          # for date & time formats\nlibrary(ggpubr)             # for creating and customizing ggplot2\nlibrary(skimr)              # for data summary\n","metadata":{"execution":{"iopub.status.busy":"2022-10-29T01:37:03.064647Z","iopub.execute_input":"2022-10-29T01:37:03.067102Z","iopub.status.idle":"2022-10-29T01:37:04.184075Z"},"trusted":true},"execution_count":1,"outputs":[{"name":"stderr","text":"── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.2 ──\n\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.5 \n\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.1 \n\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2 \n── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n\nAttaching package: ‘janitor’\n\n\nThe following objects are masked from ‘package:stats’:\n\n    chisq.test, fisher.test\n\n\n\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    date, intersect, setdiff, union\n\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"The dataset that will be used focus on a day-to-day dataset that can answer business tasks:\n* dailyActivity_merged.csv\n* dailyCalories_merged.csv\n* dailyIntensities_merged.csv\n* dailySteps_merged.csv\n* sleepDay_merged.csv\n* weightLogInfo_merged.csv","metadata":{}},{"cell_type":"code","source":"#import and assign name\n\ndaily_activity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\")\ndaily_calories <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyCalories_merged.csv\")\ndaily_intensities <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyIntensities_merged.csv\")\ndaily_steps <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailySteps_merged.csv\")\nsleep <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv\")\nweight <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/weightLogInfo_merged.csv\")\n\n#snapshoot the dataset\nhead(daily_activity)\nhead(daily_calories)\nhead(daily_intensities)\nhead(daily_steps)\nhead(sleep)\nhead(weight)","metadata":{"execution":{"iopub.status.busy":"2022-10-29T01:37:04.186074Z","iopub.execute_input":"2022-10-29T01:37:04.223329Z","iopub.status.idle":"2022-10-29T01:37:04.396583Z"},"trusted":true},"execution_count":2,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 6 × 15</caption>\n<thead>\n\t<tr><th></th><th scope=col>Id</th><th scope=col>ActivityDate</th><th scope=col>TotalSteps</th><th scope=col>TotalDistance</th><th scope=col>TrackerDistance</th><th scope=col>LoggedActivitiesDistance</th><th scope=col>VeryActiveDistance</th><th scope=col>ModeratelyActiveDistance</th><th scope=col>LightActiveDistance</th><th scope=col>SedentaryActiveDistance</th><th scope=col>VeryActiveMinutes</th><th scope=col>FairlyActiveMinu