 described above.\n\nPreviously, it was introduced again that Bellabeat is a high-tech company that produces **smart products** focused on health. Its products are specially designed for women to **empower women** with knowledge about their own health and habits.\n\nThe findings obtained can still be **explored more deeply** because there are still datasets that have not been analyzed. Existing limitations may also make **false** the results of this analysis such as the number of participants which is approximately 30 people, there is no age, gender, occupation, incomplete weight and height, and others.\n\nThe recommendations that can be given and applied to the Bellabeat product marketing strategy are:\n1. The average total steps of participants is 7406 per day, this **needs to be increased** to a minimum of 10,000/day (based on the Centers for Disease Control and Prevention (CDC)) by providing reminder notifications to be diligent\n2. Average `sedentary minute` for participants is 16.5 hours/day, this can be **reduced** by giving reminder notifications if you have been sitting too long\n3. There are still participants who do not have **ideal hours of sleep** so they can provide bedtime notifications\n4. The majority of participants are **lightly active** which means they rarely do physical activity/sports. Some things that can be applied to encourage participants are by **connecting users** and closest friends on the Bellabeat application, so that they can share physical activities, suggestions, tips, and other useful things that have been done.\n4. Make **leaderboard** calories and total steps so that participants are excited to compete in sports with relatives or other people\n5. Provide a consultation room with **professional trainers** online due to the busy activity of participants\n6. Create a **membership subscription** for a more personalized experience, so that participants are more confident and trust to share privacy matters such as weight and height\n\nThereby recommendations that can be given, this analysis is still far from perfect. Thank you for reading!","metadata":{}}]}